function getNodes(grid) {
    const nodes = []
    for (let row of grid) {
        const currRow = []
        for(var node of row) {
            const currNode = node
            currRow.push(currNode)
        }
        nodes.push(currRow)
    }
    return nodes 
}

export default Dijkstra
